export const PostForm = () => {
  return (
    <div>

    <Formik initialValues={{
      title:"",
      description:""
    }}>
      <Form>
        <Field name="title" placeholder="title"/>
        <Field name="description" placeholder="description"/>
      </Form>
    </Formik>

    </div>
  )
}
